export default (function(a,b,c,d,e,f,g,h,i){return {data:{uWriz6es1Z:{data:{id:1852,attributes:{imdbId:"tt3531824",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTUzOTg1OTM4NV5BMl5BanBnXkFtZTgwMTg2Mjg0OTE@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.5\u002F10"},{Source:"Rotten Tomatoes",Value:"66%"},{Source:"Metacritic",Value:"58\u002F100"}],item_lang:{data:{id:2515,attributes:{title:d,plot:"'Nerve' is about an online dare game, in which people give participants anonymous dares for money. The participants compete with each other to win the grand prize as the dares get tougher. Things get worse when the tasks get increasingly dangerous and lives are at stake.",slug:"nerve"}}},books:{data:[{id:9397,attributes:{title:d,description:f,thumbnail:g,authors:[b],firstBook:true,published:h,publisher:e,subtitle:a}},{id:9398,attributes:{title:d,description:f,thumbnail:g,authors:[b],firstBook:c,published:h,publisher:e,subtitle:a}},{id:9399,attributes:{title:i,description:"A heartracing thriller from the New York Times bestselling author of NERVE, the book that launched the major motion picture! Aislyn suffers from crippling shyness—that is, until she’s offered a dose of Charisma, an underground gene therapy drug guaranteed to make her shine. The effects are instant. She’s charming, vivacious, and popular. But strangely, so are some other kids she knows. The media goes into a frenzy when the disease turns contagious, and then deadly, and the doctor who gave it to them disappears. Aislyn must find a way to stop it, before it's too late. Part medical thriller, part social justice commentary, Charisma will have readers on the edge of their seats.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=J43MAwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:c,published:"2015-03-03",publisher:e,subtitle:a}},{id:9400,attributes:{title:"Addict",description:"Êtes-vous plutôt Joueur... ou Voyeur ? Addict est un jeu qui diffuse sur Internet des défis filmés en direct. Vee, 17 ans, n'est pas sûre d'avoir le cran d'y participer. Mais les organisateurs connaissent ses désirs les plus secrets et finissent par la convaincre, avec des cadeaux qu'elle ne peut refuser... et un partenaire irrésistible. Une fois en équipe avec le beau Ian, Vee ne peut qu'accepter le défi suivant, puis un autre, et encore un autre... D'autant que l'engouement des milliers de Voyeurs en ligne la pousse à dépasser ses limites et ses peurs. Bientôt, le jeu prend un tournant plus que malsain : il devient dangereux, voire mortel. Mais comment décrocher quand on est pris dans l'engrenage ?",thumbnail:a,authors:[b],firstBook:c,published:"2016-08-25",publisher:a,subtitle:a}},{id:9401,attributes:{title:i,description:"Prêt(e) à tout pour devenir populaire ? Aislyn est d'une timidité maladive : impossible pour elle de prendre la parole en public, et c'est encore pire quand il s'agit de discuter avec un garçon... Alors quand on lui propose du Charisma, drogue de thérapie génique supposée la guérir, elle n'hésite pas bien longtemps. Du jour au lendemain, la voilà devenue charmante et populaire. Mais Aislyn n'est pas la seule à avoir subi l'injection, et il s'avère que ce traitement miracle a de terribles effets secondaires...",thumbnail:a,authors:[b],firstBook:c,published:"2018-06-07",publisher:a,subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940955774}}("","Jeanne Ryan",null,"Nerve","Penguin","The New York Times bestseller is now a major motion picture starring Emma Roberts and Dave Franco, in theaters this July! A high-stakes online game of dares turns deadly When Vee is picked to be a player in NERVE, an anonymous game of dares broadcast live online, she discovers that the game knows her. They tempt her with prizes taken from her ThisIsMe page and team her up with the perfect boy, sizzling-hot Ian. At first it's exhilarating--Vee and Ian's fans cheer them on to riskier dares with higher stakes. But the game takes a twisted turn when they're directed to a secret location with five other players for the Grand Prize round. Suddenly they're playing all or nothing, with their lives on the line. Just how far will Vee go before she loses NERVE? Debut author Jeanne Ryan delivers an un-putdownable suspense thriller.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=NwBJEFH8Yj0C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2012-09-13","Charisma"))